def fibonacci(n):
    if n <= 0:
        return "Input needs to be positive"
    elif n == 1:
        return 1
    elif n == 2:
        return 1  
    else:
        fib_sequence = [1, 1]
        for i in range(2, n):
            fib_sequence.append(fib_sequence[i-1]+fib_sequence[i-2])
        return fib_sequence[n-1]
